const heading = document.querySelector('h1');
let count = 0;
const IncNum = ()=>{
    
    count++;
}

const App = () => {
    return (
        <>
            <h1>{count}</h1>
            <button onClick={IncNum}> Click Me </button>
        </>
    );
};

export default App;
